export function userReducer(state = initialState, action) {// สร้าง reducer สำหรับการเปลี่ยนแปลงข้อมูลของ state
  switch (action.type) {// ตรวจสอบว่า action ที่ส่งมาเป็นอะไร
    case "LOGIN":
      return "5555 login";
    case "LOGOUT":
      return "5555 logout";
    default:
        return state;// ค่า null 
  }
}
